"""
https://www.codewars.com/kata/find-the-cheapest-path

Re-attempted using an approximation of the Dijkstra algorithm.
"""

def get_adjacents(cell):
    x = cell[0]
    y = cell[1]
    return [(x-1,y),(x+1,y),(x,y-1),(x,y+1)]

def cheapest_path(t, start, finish):
    #Special case for no path:
    if start==finish:
        return []

    #Define a cost map, showing the cost to reach each point from start. Initially, all costs are undefined:
    height = len(t)
    width = len(t[0])
    costs = [[-1 for _ in range(width)] for _ in range(height)]
    #Set the start cell's cost to 0:
    costs[start[0]][start[1]] = 0

    #Define a predecessor map, showing the best coordinates from which to enter each cell:
    predecessors = [[() for _ in range(width)] for _ in range(height)]

    #Start from the start point, mapping out the total cost to reach each adjacent node:
    current = start
    todo_list = []
    visited = []
    counter = 0
    while current != finish:
        counter += 1
        if counter%100==0:
            print(counter)
        visited += [current]
        for x,y in get_adjacents(current):
            #Make sure we only use a step if it's a valid, unvisited point:
            if 0<=x<height and 0<=y<width and (x,y) not in visited:
                #Add this point to to-do list:
                if (x,y) not in todo_list:
                    todo_list += [(x,y)]
                #Calculate the total cost to reach this point via the current point:
                new_cost = t[x][y] + costs[current[0]][current[1]]
                #Replace the value in our cost map if the new cost is better. Also update the predecessors map:
                if costs[x][y] == -1 or new_cost < costs[x][y]:
                    costs[x][y] = new_cost
                    predecessors[x][y] = (current[0],current[1])
        #Now repeat this with the cheapest unvisited vertex as 'current'
        candidates = [costs[x][y] for x,y in todo_list]
        mincost,idx = min((cost,idx) for (idx,cost) in enumerate(candidates))
        current = todo_list.pop(idx)

    #Retrace the steps back from finish:
    current = finish
    directions = []
    while current != start:
        x = current[0]
        y = current[1]
        current = predecessors[x][y]
        if current[0]-x == 1:
            directions = ['up'] + directions
        elif current[0]-x == -1:
            directions = ['down'] + directions
        elif current[1]-y == 1:
            directions = ['left'] + directions
        elif current[1]-y == -1:
            directions = ['right'] + directions

    return directions

